import React from 'react';
import '../App.css';
import {Link, useParams} from 'react-router-dom';
import {projects} from '../Portfolio/portfolio.js';



function ProjectPage(props) {
  let { id } = useParams();
  console.log(projects);
  // find id in projects
  //const project = projects.find(project => project.linkpath === `/project-page/${id}`)
  const project = projects.find(function (project) {
    return project.linkpath === `/project-page/${id}`
  });

  return(
        <figure className="project-preview">
          <h2>{project.name}</h2>
          <p>Elegant yet classic, colorful yet uncomplicated, casual yet sophisticated â€” a classically indecisive millennial with interests running the gamut, my brand expresses my multitudes.</p>

          <p>In continuation of an ongoing existential conversation with myself, this project was an opportunity to distill my personality and style into a brand that suggests, but does not limit who I am.</p>

          <p>The rich and bold color scheme and iconic, while whimsical, design is influenced by Italian landscapes, vintage fashion, and wild tuscan poppies in bloom. My brand honors the beauty of careful simplicity.</p>
        </figure>
    )
}


export default ProjectPage;
